PersistentStorage is a persistent storage implementation that stores the replicated log and the state of OmniPaxos. The struct uses Commitlog to store the replicated log, and the state is stored on sled by default. The state can be changed to be stored on RocksDB instead of sled by using the feature rocksdb. Users can configure the path to log entries and OmniPaxos state, and storage-related options through PersistentStorageConfig. The configuration struct features a default() constructor for generating default configuration, and the constructor with() that takes the storage path and options as arguments. use omnipaxos_core::{ sequence_paxos::{OmniPaxos, OmniPaxosConfig},
};
use omnipaxos_storage::{ persistent_storage::{PersistentStorage, PersistentStorageConfig},
};
use commitlog::LogOptions;
use sled::{Config}; // user-defined configuration
let my_path = "my_storage"
let my_log_opts = LogOptions::new(my_path);
let mut my_sled_opts = Config::new();
my_sled_opts.path(self, my_path); // generate default configuration and set user-defined options
let mut my_config = PersistentStorageConfig::default();
my_config.set_path(my_path);
my_config.set_commitlog_options(my_logopts);
my_config.set_sled_options(my_sled_opts); The same configuration can also be done with the constructor that takes arguments: let my_path = "another_storage"
let my_logopts = LogOptions::new(my_path);
let mut my_sled_opts = Config::new();
my_sled_opts.path(my_path);
my_sled_opts.new(true); // create configuration with given arguments
let my_config = PersistentStorageConfig::with(my_path, my_logopts, my_sled_opts);

